<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <link rel="stylesheet" href="https://cdn.jsdelivr.net/gh/newcat/typedoc-spa@77135742a1b18131b96fe980005113e2c5aa6e46/dist/typedoc-spa.css">
    <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Noto+Sans"> 
    <title>BaklavaJS - Reference</title>
</head>
<body>
    <div id="app"></div>
    <script>
    window.$typedoc = {
      modules: [
        { name: "@baklavajs/core", file: "core.json" },
        { name: "@baklavajs/plugin-engine", file: "plugin-engine.json" },
        { name: "@baklavajs/plugin-interface-types", file: "plugin-interface-types.json" }
      ]
    }
    </script>
    <script src="https://cdn.jsdelivr.net/gh/newcat/typedoc-spa@77135742a1b18131b96fe980005113e2c5aa6e46/dist/typedoc-spa.js"></script>

</html>
